import React from "react";

const CaughtPokemon = (props) => {
  const date = new Date().toLocaleDateString();
  return (
    <div>
      <p> Caught 0 pokemon's on {props.date} </p>
      <span>{props.date}</span>
    </div>
  );
};


export default CaughtPokemon;
